import { useEffect, useState } from 'react';

const baseUrl = 'https://jsonplaceholder.typicode.com';

function App() {
  const [data, setData] = useState(null);

  const fetchUrl = (type) => {
    fetch(baseUrl + '/' + type)
      .then(res => res.json())
      .then((res) => setData(res))
  }

  useEffect(() => {
    fetchUrl("users")
  }, [])

  return (
    <div>
      <h1>useFetch</h1>
      <button onClick={() => fetchUrl()}>Users</button>
      <button>Posts</button>
      <button>Todos</button>
      <pre>{JSON.stringify(data, null, 2)}</pre>
    </div>
  );
}

export default App;
